"<p>This is a demo of a featured post.</p>\n\n<p>It will be featured whenever we have no specific \"Intro\" post to display for the current request. To see it in action, try displaying the \"Announcements\" category.</p>\n\n<p>Also note that when the post is featured, it does not appear in the regular post flow.</p>" => "<p>–≠—Ç–æ –ø—Ä–∏–º–µ—Ä –∏–∑–±—Ä–∞–Ω–Ω–æ–π –∑–∞–ø–∏—?–∏.</p>\n\n<p>–û–Ω–∞ –±—É–¥–µ—Ç –≤—ã–≤–æ–¥–∏—Ç—å—?—? –ø–µ—Ä–≤–æ–π –≤ —?–ª—É—á–∞—?—Ö, –∫–æ–≥–¥–∞ –Ω–µ –∑–∞–¥–∞–Ω–∞ —?–ø–µ—Ü–∏–∞–ª—å–Ω–∞—? \"–ò–Ω—Ç—Ä–æ\" –∑–∞–ø–∏—?—å –¥–ª—? —Ç–µ–∫—É—â–µ–≥–æ –∑–∞–ø—Ä–æ—?–∞.</p>\n\n<p>–ó–∞–º–µ—Ç—å—Ç–µ, –µ—?–ª–∏ –∑–∞–ø–∏—?—å —?–≤–ª—?–µ—Ç—?—? –∏–∑–±—Ä–∞–Ω–Ω–æ–π, –æ–Ω–∞ –Ω–µ –ø–æ—?–≤–ª—?–µ—Ç—?—? –≤ –û—?–Ω–æ–≤–Ω–æ–º –ø–æ—Ç–æ–∫–µ –∑–∞–ø–∏—?–µ–π.</p>",
"<p>b2evolution comes with an <code>.htaccess</code> file destined to optimize the way b2evolution is handled by your webseerver (if you are using Apache). In some circumstances, that file may not be automatically activated at setup. Please se the man page about <a %s>Tricky Stuff</a> for more information.</p>\n\n<p>For further optimization, please review the manual page about <a %s>Performance optimization</a>. Depending on your current configuration and on what your <a %s>web hosting</a> company allows you to do, you may increase the speed of b2evolution by up to a factor of 10!</p>" => "<p>–ü—Ä–∏ —É—?—Ç–∞–Ω–æ–≤–∫–µ b2evolution –±—É–¥–µ—Ç –∞–∫—Ç–∏–≤–∏—Ä–æ–≤–∞–Ω —Ñ–∞–π–ª <code>.htaccess</code>, –≤ –∫–æ—Ç–æ—Ä–æ–º –∑–∞–¥–∞–Ω—ã –ø–∞—Ä–∞–º–µ—Ç—Ä—ã —?–µ—Ä–≤–µ—Ä–∞ (—Ç–æ–ª—å–∫–æ –¥–ª—? Apache), –Ω–µ–æ–±—Ö–æ–¥–∏–º—ã–µ –¥–ª—? –æ–ø—Ç–∏–º–∞–ª—å–Ω–æ–π —Ä–∞–±–æ—Ç—ã b2evolution. –ï—?–ª–∏ –ø—Ä–∏ —É—?—Ç–∞–Ω–æ–≤–∫–µ b2evolution –∞–≤—Ç–æ–º–∞—Ç–∏—á–µ—?–∫–∞—? –∞–∫—Ç–∏–≤–∞—Ü–∏—? —?—Ç–æ–≥–æ —Ñ–∞–π–ª–∞ –Ω–µ —É–¥–∞–ª–∞—?—å, –≤–∞–º —?–ª–µ–¥—É–µ—Ç <a %s>–æ–±—Ä–∞—Ç–∏—Ç—å—?—? –∫ –¥–æ–∫—É–º–µ–Ω—Ç–∞—Ü–∏–∏</a>.</p>\n\n<p>–î–ª—? –¥–∞–ª—å–Ω–µ–π—à–µ–π –æ–ø—Ç–∏–º–∏–∑–∞—Ü–∏–∏, –æ–±—Ä–∞—Ç–∏—Ç–µ—?—å –∫ –∏–Ω—?—Ç—Ä—É–∫—Ü–∏–∏ <a %s>–£–ª—É—á—à–µ–Ω–∏–µ –ø—Ä–æ–∏–∑–≤–æ–¥–∏—Ç–µ–ª—å–Ω–æ—?—Ç–∏</a>. –í –∑–∞–≤–∏—?–∏–º–æ—?—Ç–∏ –æ—Ç —Ç–µ–∫—É—â–∏—Ö –Ω–∞—?—Ç—Ä–æ–µ–∫, –∞ —Ç–∞–∫ –∂–µ –æ—Ç –≤–æ–∑–º–æ–∂–Ω–æ—?—Ç–µ–π –≤–∞—à–µ–≥–æ <a %s>–≤–µ–± —?–µ—Ä–≤–µ—Ä–∞</a> –≤—ã —?–º–æ–∂–µ—Ç–µ —É–≤–µ–ª–∏—á–∏—Ç—å —?–∫–æ—Ä–æ—?—Ç—å —Ä–∞–±–æ—Ç—ã b2evolution –¥–æ 10 —Ä–∞–∑!</p>",
'Apache optimization...' => '–û–ø—Ç–∏–º–∏–∑–∞—Ü–∏—? Apache...',
"<p>By default, blogs are displayed using an evoskin. (More on skins in another post.)</p>\n\n<p>This means, blogs are accessed through '<code>index.php</code>', which loads default parameters from the database and then passes on the display job to a skin.</p>\n\n<p>Alternatively, if you don't want to use the default DB parameters and want to, say, force a skin, a category or a specific linkblog, you can create a stub file like the provided '<code>a_stub.php</code>' and call your blog through this stub instead of index.php .</p>\n\n<p>Finally, if you need to do some very specific customizations to your blog, you may use plain templates instead of skins. In this case, call your blog through a full template, like the provided '<code>a_noskin.php</code>'.</p>\n\n<p>If you want to integrate a b2evolution blog into a complex website, you'll probably want to do it by copy/pasting code from <code>a_noskin.php</code> into a page of your website.</p>\n\n<p>You will find more information in the stub/template files themselves. Open them in a text editor and read the comments in there.</p>\n\n<p>Either way, make sure you go to the blogs admin and set the correct access method/URL for your blog. Otherwise, the permalinks will not function properly.</p>" => "<p>–ü–æ —É–º–æ–ª—á–∞–Ω–∏—é, –±–ª–æ–≥–∏ –æ—Ç–æ–±—Ä–∞–∂–∞—é—Ç—?—? –∏—?–ø–æ–ª—å–∑—É—? evoskin —Ç.–µ. —Ç–µ–º—É. –ü–æ–¥—Ä–æ–±–Ω–µ–µ –æ–± –∏—?–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–∏ —Ç–µ–º –≤—ã —?–º–æ–∂–µ—Ç–µ –ø—Ä–æ—á–µ—?—Ç—å –≤ –¥—Ä—É–≥–æ–π –∑–∞–ø–∏—?–∏.</p>\n\n<p>–≠—Ç–æ –æ–∑–Ω–∞—á–∞–µ—Ç —á—Ç–æ –±–ª–æ–≥–∏ –≤—ã–∑—ã–≤–∞—é—Ç—?—? —á–µ—Ä–µ–∑ —Ñ–∞–π–ª '<code>index.php</code>', –∫–æ—Ç–æ—Ä—ã–π –∑–∞–≥—Ä—É–∂–∞–µ—Ç –∏—?—Ö–æ–¥–Ω—ã–µ –ø–∞—Ä–∞–º–µ—Ç—Ä—ã –∏–∑ –±–∞–∑—ã –¥–∞–Ω–Ω—ã—Ö –∏ –∑–∞—Ç–µ–º \"–ø–æ–∫–∞–∑—ã–≤–∞–µ—Ç\" –∏—Ö —á–µ—Ä–µ–∑ —Ñ–∞–π–ª—ã —Ç–µ–º—ã.</p>\n\n<p>–í —?–ª—É—á–∞–µ, –∫–æ–≥–¥–∞ –≤—ã –Ω–µ —Ö–æ—Ç–∏—Ç–µ –∏—?–ø–æ–ª—å–∑–æ–≤–∞—Ç—å –ø–∞—Ä–∞–º–µ—Ç—Ä—ã –ø–æ —É–º–æ–ª—á–∞–Ω–∏—é –∏ —Ö–æ—Ç–∏—Ç–µ, —?–∫–∞–∂–µ–º, –≤—ã–∑–≤–∞—Ç—å —Ç–µ–º—É, —Ä—É–±—Ä–∏–∫—É –∏–ª–∏ –æ–ø—Ä–µ–¥–µ–ª–µ–Ω–Ω—ã–π –±–ª–æ–≥, –≤—ã –º–æ–∂–µ—Ç–µ —?–æ–∑–¥–∞—Ç—å —Ñ–∞–π–ª-–∑–∞–≥–ª—É—à–∫—É (stub file) –∫–∞–∫, –Ω–∞–ø—Ä–∏–º–µ—Ä, '<code>a_stub.php</code>' –∏ –≤—ã–∑—ã–≤–∞—Ç—å –≤–∞—à –±–ª–æ–≥ —á–µ—Ä–µ–∑ —?—Ç—É –∑–∞–≥–ª—É—à–∫—É –≤–º–µ—?—Ç–æ index.php .</p>\n\n<p>–ò –Ω–∞–∫–æ–Ω–µ—Ü, –µ—?–ª–∏ –≤—ã —Ö–æ—Ç–∏—Ç–µ –≤—ã–ø–æ–ª–Ω–∏—Ç—å —Ç–æ–Ω–∫—É—é –Ω–∞—?—Ç—Ä–æ–π–∫—É –≤–∞—à–µ–≥–æ –±–ª–æ–≥–∞, –≤—ã –º–æ–∂–µ—Ç–µ –∏—?–ø–æ–ª—å–∑–æ–≤–∞—Ç—å –ø—Ä–æ—?—Ç—ã–µ —à–∞–±–ª–æ–Ω—ã –≤–º–µ—?—Ç–æ —Ç–µ–º. –í —Ç–∞–∫–æ–º —?–ª—É—á–∞–µ –≤—ã –≤—ã–∑—ã–≤–∞–µ—Ç–µ –≤–∞—à –±–ª–æ–≥ —á–µ—Ä–µ–∑ –ø–æ–ª–Ω—ã–π —à–∞–±–ª–æ–Ω, –∫–∞–∫, –Ω–∞–ø—Ä–∏–º–µ—Ä '<code>a_noskin.php</code>'.</p>\n\n<p>–ï—?–ª–∏ –≤—ã —Ö–æ—Ç–∏—Ç–µ –∏–Ω—Ç–µ–≥—Ä–∏—Ä–æ–≤–∞—Ç—å –æ—Ç–¥–µ–ª—å–Ω—ã–π –±–ª–æ–≥ b2evolution –≤ —É–∂–µ –∏–º–µ—é—â–∏–π—?—? —?–∞–π—Ç, –≤—ã, –≤–æ–∑–º–æ–∂–Ω–æ, –∑–∞—Ö–æ—Ç–∏—Ç–µ —?–¥–µ–ª–∞—Ç—å —?—Ç–æ –ø—É—Ç–µ–º –≤—?—Ç–∞–≤–∫–∏ –æ—Ç–¥–µ–ª—å–Ω—ã—Ö –±–ª–æ–∫–æ–≤ –∫–æ–¥–∞ –∏–∑ <code>a_noskin.php</code> –≤ —?—Ç—Ä–∞–Ω–∏—Ü—É –≤–∞—à–µ–≥–æ –≤–µ–± —?–∞–π—Ç–∞.</p>\n\n<p>–î–æ–ø–æ–ª–Ω–∏—Ç–µ–ª—å–Ω—É—é –∏–º—Ñ–æ—Ä–º–∞—Ü–∏—é –≤—ã –Ω–∞–π–¥–µ—Ç–µ –Ω–µ–ø–æ—?—Ä–µ–¥—?—Ç–≤–µ–Ω–Ω–æ –≤ —Ñ–∞–π–ª–∞—Ö-–∑–∞–≥–ª—É—à–∫–∞—Ö –∏ —à–∞–±–ª–æ–Ω–∞—Ö. –û—Ç–∫—Ä–æ–π—Ç–µ –∏—Ö –≤ —Ç–µ–∫—?—Ç–æ–≤–æ–º —Ä–µ–¥–∞–∫—Ç–æ—Ä–µ –∏ –ø—Ä–æ—á–∏—Ç–∞–π—Ç–µ –∫–æ–º–º–µ–Ω—Ç–∞—Ä–∏–∏.</p>\n\n<p>–í –ª—é–±–æ–º —?–ª—É—á–∞–µ, —É–±–µ–¥–∏—Ç–µ—?—å —á—Ç–æ –≤—ã —É—?—Ç–∞–Ω–æ–≤–∏–ª–∏ –∫–æ—Ä—Ä–µ–∫—Ç–Ω—ã–π –º–µ—Ç–æ–¥ –≤—ã–∑–æ–≤–∞ (URL) –≤–∞—à–∏—Ö –±–ª–æ–≥–æ–≤ –≤ –ø–∞–Ω–µ–ª–∏ —É–ø—Ä–∞–≤–ª–µ–Ω–∏—?. –í –ø—Ä–æ—Ç–∏–≤–Ω–æ–º —?–ª—É—á–∞–µ, –ø–æ—?—Ç–æ—?–Ω–Ω—ã–µ —?—?—ã–ª–∫–∏ –Ω–µ –±—É–¥—É—Ç —Ä–∞–±–æ—Ç–∞—Ç—å –∫–æ—Ä—Ä–µ–∫—Ç–Ω–æ.</p>",
'Skins, Stubs, Templates &amp; website integration...' => '–¢–µ–º—ã, –ó–∞–≥–ª—É—à–∫–∏, –®–∞–±–ª–æ–Ω—ã –∏ –∏–Ω—Ç–µ–≥—Ä–∞—Ü–∏—? —?–∞–π—Ç–∞...',
"<p>b2evolution blogs are installed with a default selection of Widgets. For example, the sidebar of this blog includes widgets like a calendar, a search field, a list of categories, a list of XML feeds, etc.</p>\n\n<p>You can add, remove and reorder widgets from the Blog Settings tab in the admin interface.</p>\n\n<p>Note: in order to be displayed, widgets are placed in containers. Each container appears in a specific place in an evoskin. If you change your blog skin, the new skin may not use the same containers as the previous one. Make sure you place your widgets in containers that exist in the specific skin you are using.</p>" => "<p>–ë–ª–æ–≥–∏ b2evolution —É—?—Ç–∞–Ω–æ–≤–ª–µ–Ω—ã —? –Ω–∞–±–æ—Ä–æ–º –≤–∏–¥–∂–µ—Ç–æ–≤ –ø–æ —É–º–æ–ª—á–∞–Ω–∏—é. –?–∞–ø—Ä–∏–º–µ—Ä, –±–æ–∫–æ–≤–∞—? –ø–∞–Ω–µ–ª—å —?—Ç–æ–≥–æ –±–ª–æ–≥–∞ –≤–∫–ª—é—á–∞–µ—Ç —Ç–∞–∫–∏–µ –≤–∏–¥–∂–µ—Ç—ã –∫–∞–∫ –∫–∞–ª–µ–Ω–¥–∞—Ä—å, –ø–æ–ª–µ –ø–æ–∏—?–∫–∞, —?–ø–∏—?–æ–∫ —Ä—É–±—Ä–∏–∫, —?–ø–∏—?–æ–∫ –ª–µ–Ω—Ç XML, –∏ —Ç.–¥.</p>\n\n<p>–í—ã –º–æ–∂–µ—Ç–µ –¥–æ–±–∞–≤–∏—Ç—å, —É–¥–∞–ª–∏—Ç—å –∏–ª–∏ –ø–µ—Ä–µ—?–æ—Ä—Ç–∏—Ä–æ–≤–∞—Ç—å –≤–∏–¥–∂–µ—Ç—ã –∏–∑ –≤–∫–ª–∞–¥–∫–∏ –?–∞—?—Ç—Ä–æ–π–∫–∏ –ë–ª–æ–≥–∞ –≤ –∞–¥–º–∏–Ω–∏—?—Ç—Ä–∞—Ç–∏–≤–Ω–æ–º –∏–Ω—Ç–µ—Ä—Ñ–µ–π—?–µ.</p>\n\n<p>–ü—Ä–∏–º–µ—á–∞–Ω–∏–µ: —á—Ç–æ–±—ã –æ—Ç–æ–±—Ä–∞–∂–∞—Ç—å—?—?, –≤–∏–¥–∂–µ—Ç—ã –ø–æ–º–µ—â–∞—é—Ç—?—? –≤ –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä—ã. –ö–∞–∂–¥—ã–π –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä –Ω–∞—Ö–æ–¥–∏—Ç—?—? –≤ –æ–ø—Ä–µ–¥–µ–ª–µ–Ω–Ω–æ–º –º–µ—?—Ç–µ –≤ —Ç–µ–º–µ. –ï—?–ª–∏ –≤—ã —?–º–µ–Ω–∏—Ç–µ —Ç–µ–º—É –≤–∞—à–µ–≥–æ –±–ª–æ–≥–∞, –Ω–æ–≤–∞—? —Ç–µ–º–∞, –≤–æ–∑–º–æ–∂–Ω–æ, –Ω–µ –±—É–¥–µ—Ç –∏—?–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —Ç–µ –∂–µ –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä—ã —á—Ç–æ –∏ —?—Ç–∞—Ä–∞—?. –£–±–µ–¥–∏—Ç–µ—?—å —á—Ç–æ –≤—ã –ø–æ–º–µ—â–∞–µ—Ç–µ –≤–∞—à–∏ –≤–∏–¥–∂–µ—Ç—ã –≤ –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä—ã, –∫–æ—Ç–æ—Ä—ã–µ —?—É—â–µ—?—Ç–≤—É—é—Ç –≤ —Ç–µ–º–µ, –∫–æ—Ç–æ—Ä—É—é –≤—ã –∏—?–ø–æ–ª—å–∑—É–µ—Ç–µ.</p>",
'About widgets...' => '–û –≤–∏–¥–∂–µ—Ç–∞—Ö...',
"<p>By default, b2evolution blogs are displayed using an evoskin.</p>\n\n<p>You can change the skin used by any blog by editing the blog settings in the admin interface.</p>\n\n<p>You can download additional skins from the <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">skin site</a>. To install them, unzip them in the /blogs/skins directory, then go to General Settings &gt; Skins in the admin interface and click on \"Install new\".</p>\n\n<p>You can also create your own skins by duplicating, renaming and customizing any existing skin folder from the /blogs/skins directory.</p>\n\n<p>To start customizing a skin, open its \"<code>index.main.php</code>\" file in an editor and read the comments in there. Note: you can also edit skins in the \"Files\" tab of the admin interface.</p>\n\n<p>And, of course, read the <a href=\"http://b2evolution.net/man/skin-structure\" target=\"_blank\">manual on skins</a>!</p>" => "<p>–ü–æ —É–º–æ–ª—á–∞–Ω–∏—é, –±–ª–æ–≥–∏ b2evolution –æ—Ç–æ–±—Ä–∞–∂–∞—é—Ç—?—? —? –ø–æ–º–æ—â—å—é —Ç–µ–º.</p>\n\n<p>–í—ã –º–æ–∂–µ—Ç–µ –∏–∑–º–µ–Ω–∏—Ç—å —Ç–µ–º—É, –∏—?–ø–æ–ª—å–∑—É–µ–º—É—é –±–ª–æ–≥–æ–º, —Ä–µ–¥–∞–∫—Ç–∏—Ä—É—? –Ω–∞—?—Ç—Ä–æ–π–∫–∏ –±–ª–æ–≥–∞ –≤ –∞–¥–º–∏–Ω–∏—?—Ç—Ä–∞—Ç–∏–≤–Ω–æ–º –∏–Ω—Ç–µ—Ä—Ñ–µ–π—?–µ.</p>\n\n<p>–í—ã –º–æ–∂–µ—Ç–µ –∑–∞–≥—Ä—É–∑–∏—Ç—å –¥–æ–ø–æ–ª–Ω–∏—Ç–µ–ª—å–Ω—ã–µ —Ç–µ–º—ã —? <a href=\"http://skins.b2evolution.net/\" target=\"_blank\">—?–∞–π—Ç–∞ —Ç–µ–º</a>. –î–ª—? —É—?—Ç–∞–Ω–æ–≤–∫–∏, —Ä–∞—?–ø–∞–∫—É–π—Ç–µ –∏—Ö –≤ –ø–∞–ø–∫—É /blogs/skins, –ó–∞—Ç–µ–º –ø–µ—Ä–µ–π–¥–∏—Ç–µ –≤ –ì–ª–æ–±–∞–ª—å–Ω—ã–µ –Ω–∞—?—Ç—Ä–æ–π–∫–∏ &gt; –£—?—Ç–∞–Ω–æ–≤–∫–∞ —Ç–µ–º–≤ –≤ –∞–¥–º–∏–Ω–∏—?—Ç—Ä–∞—Ç–∏–≤–Ω–æ–º –∏–Ω—Ç–µ—Ä—Ñ–µ–π—?–µ –∏ —â–µ–ª–∫–Ω–∏—Ç–µ \"–£—?—Ç–∞–Ω–æ–≤–∏—Ç—å –Ω–æ–≤—É—é\".</p>\n\n<p>–í—ã —Ç–∞–∫–∂–µ –º–æ–∂–µ—Ç–µ —?–æ–∑–¥–∞—Ç—å –≤–∞—à–∏ —?–æ–±—?—Ç–≤–µ–Ω–Ω—ã–µ —Ç–µ–º—ã –ø—É—Ç–µ–º –∫–æ–ø–∏—Ä–æ–≤–∞–Ω–∏—?, –ø–µ—Ä–µ–∏–º–µ–Ω–æ–≤–∞–Ω–∏—? –∏ –Ω–∞—?—Ç—Ä–∞–∏–≤–∞–Ω–∏—? —?—É—â–µ—?—Ç–≤—É—é—â–µ–π –ø–∞–ø–∫–∏ —Ç–µ–º—ã –≤ –ø–∞–ø–∫–µ /blogs/skins.</p>\n\n<p>–ß—Ç–æ–±—ã –ø—Ä–∏—